/* C-style .includes. This function will properly swap input conf buffers,
 * and lineno -kre */
static void
conf_include(void)
{
  char *p;

  if ((p = strchr(yytext, '<')) == NULL)
    *strchr(p = strchr(yytext, '"') + 1, '"') = '\0';
  else
    *strchr(++p, '>') = '\0';

  /* do stacking and co. */
  if (include_stack_ptr >= MAX_INCLUDE_DEPTH)
  {
    log_write(LOG_TYPE_IRCD, "Includes nested too deep in %s", p);
    return;
  }

  char include_path[IRCD_BUFSIZE];
  if (*p == '/')  /* if it is an absolute path */
    snprintf(include_path, sizeof(include_path), "%s", p);
  else
    snprintf(include_path, sizeof(include_path), "%s/%s", ETCPATH, p);

  FILE *include_file = fopen(include_path, "r");
  if (include_file == NULL)
  {
    log_write(LOG_TYPE_IRCD, "Unable to read configuration file '%s': %s",
              include_path, strerror(errno));
    return;
  }

  struct included_file *file = &include_stack[include_stack_ptr++];
  file->conf_line_number = conf_line_number;
  file->file = conf_parser_ctx.conf_file;
  file->state = YY_CURRENT_BUFFER;
  strlcpy(file->conf_file_name, conf_file_name, sizeof(file->conf_file_name));

  conf_line_number = 1;
  conf_parser_ctx.conf_file = include_file;
  strlcpy(conf_file_name, include_path, sizeof(conf_file_name));

  yy_switch_to_buffer(yy_create_buffer(NULL, YY_BUF_SIZE));
}

/* This is function that will be called on EOF in conf file. It will
 * apropriately close conf if it not main conf and swap input buffers -kre
 * */
static bool
conf_eof(void)
{
  if (include_stack_ptr == 0)
  {
    conf_line_number = 1;
    return true;
  }

  /* switch buffer */
  struct included_file *file = &include_stack[--include_stack_ptr];

  /* close current file */
  fclose(conf_parser_ctx.conf_file);

  /* switch buffers */
  yy_delete_buffer(YY_CURRENT_BUFFER);
  yy_switch_to_buffer(file->state);

  /* switch conf_line_number */
  conf_line_number = file->conf_line_number;

  /* switch file */
  conf_parser_ctx.conf_file = file->file;

  strlcpy(conf_file_name, file->conf_file_name, sizeof(conf_file_name));
  return false;

  /*
   * The following call to yy_fatal_error(NULL) is intentionally placed after the return statement
   * to silence the warning about yy_fatal_error being defined but not used.
   */

  /* coverity[unreachable] */
  yy_fatal_error(NULL);
}

